export default class APIService{

	// Insert an article

	static InsertData(body){
		return fetch("/test",{
      		'method':'POST',
              headers : { 
                'Content-Type': 'application/json'


      },
      body:JSON.stringify(body)
    })
	.then(response => {return response.json()})
	.catch(error => console.log(error))
	}

}
